queryMethods.rawQuery:
SELECT ?character ?name ?height WHERE {
  ?character a voc:Character;
             rdfs:label ?name;
             voc:height ?height.
  FILTER(?name = "Luke Skywalker" || ?name = "Leia Organa")
}

